import React from 'react';

function Card(props){

    return(
        <>
      
                <img src={props.imgscr}/>
                <p>{props.title}</p>
                <h1>{props.sname}</h1>
                <a href={props.link} target ="_blank">Click Me </a>
          
        </>
    );

}
export default Card;
